CREATE TABLE country (
  country_id BIGINT(20) PRIMARY KEY AUTO_INCREMENT,
  name VARCHAR(150) not null,
  initials2 VARCHAR(2) not null,
  initials3 VARCHAR(3) not null,
  international_code integer
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE state (
  state_id  BIGINT(20) PRIMARY KEY AUTO_INCREMENT,
  name VARCHAR(150) not null,
  initials VARCHAR(2) not null,
  ibge_code BIGINT(20),
  country_id BIGINT(20) not null,
  FOREIGN KEY (country_id) REFERENCES country(country_id)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE city (
  city_id BIGINT(20) PRIMARY KEY AUTO_INCREMENT,
  name VARCHAR(150) not null,
  ibge_code BIGINT(20),
  state_id BIGINT(20) not null,
  FOREIGN KEY (state_id) REFERENCES state(state_id)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;




